import React from 'react';
import logo from '../../public/assets/logo.svg';
const NavBar = () => {
    return (
        <div>
            <h1 className="text-2xl font-bold underline">
                Hello world!
            </h1>
            <img src={logo} alt="logo" />
        </div>
    );
};

export default NavBar;
